ℹ️ To see all of the currently available tools, you can check Solana and EVM toolsets Throughout rig-agent-kit follows an opinionated way of implementing tools: critical: ensuring that tools are called inside of the SignerContext block - this allows to identify the transaction signer - the owner, exposed into the closure creating a transaction for a given action executing the transaction with the TransactionSigner contained by the SignerContext (more on this in the next chapter) All of the tools return a Result<T> Wrapping the signers is tricky, so rig-onchain-kit comes with helpers, both for EVM and Solana, arriving at this concise end-result #[tool]
pub async fn transfer_sol(to: String, amount: u64) -> Result<String> { execute_solana_transaction(move |owner| async move { create_transfer_sol_tx(&Pubkey::from_str(&to)?, amount, &owner).await }) .await
} This design allows to use different transaction signing and sending methods and ensuring highly concurrent services using rig-onchain-kit work well

